import React from "react";

function App() {
  return (
    <div className="App flex w-4/5 h-screen m-auto">
      <div className="basis-2/3 my-auto ">
        <h1 className="text-8xl font-extralight">Welcome.</h1>
        <p className="font-light p-5">
          Hello my name is Bartłomiej Mojek. I’m a final-year Computer Science
          student and passionate web developer. I specialize in creating
          dynamic, user-friendly web applications using technologies like HTML,
          CSS, JavaScript, and frameworks such as React and Node.js. My goal is
          to combine my technical skills with creativity to solve real-world
          problems. Explore my projects to see my work and get in touch!
        </p>
      </div>
      <div className="my-auto text-2xl ">Projects</div>
    </div>
  );
}

export default App;
